import React from "react";
import { Dimensions } from "react-native";
import styled from "styled-components/native";
import Title from "../../components/Title";
import { FontAwesome, MaterialIcons } from '@expo/vector-icons';

const { width: WIDTH } = Dimensions.get("window");

const TextBox = styled.Text`
    display: flex;
    align-items: center;
`;
const Text = styled.Text`
    margin-left: 5px;
`;

const Container = styled.View`
  padding: 0 20px;
  align-items: center;
  flex-direction: row;
  margin-top: 20px;
`;

const utton = styled.Button`
  font-size: 10px;
  margin: 5px;
  padding: 5px 20px;
  border: 2px solid black;
  border-radius: 3px;
  background-color: white;
  font-color: black;
`;

const Athlete_button = styled.View`
    padding: 0 20px;
    margin-bottom: 20px;
`;

export default () => (
    <div>
      <Container>
        <MaterialIcons name="sports" size={24} color="black" />
        <Title title={"종목별 체육관 찾기"} />
      </Container>
      <Athlete_button>
        <Button>축구</Button>
        {/* <Button><MaterialIcons name="sports-soccer" size={24} color="black" />축구</Button> */}
        {/* <Button><MaterialIcons name="sports-basketball" size={24} color="black" />농구</Button> */}
      </Athlete_button>
    </div>
  );
